class Solution(object):
    def maxDistToClosest(self, seats):
        """
        :type seats: List[int]
        :rtype: int
        """
        occ_list = [i for i in range(len(seats)) if seats[i] == 1]
        emp_list = [i for i in range(len(seats)) if seats[i] == 0]

        dist_list = []

        for ind in emp_list:
            min_dist = float('inf')
            left_dist = 0
            right_dist = 0
            i = ind - 1
            while i >= 0:
                if i in occ_list:
                    left_dist = ind - i
                    break
                i = i - 1

            i = ind + 1
            while i < len(seats):
                if i in occ_list:
                    right_dist = i - ind
                    break
                i = i + 1
            if left_dist == 0:
                min_dist = right_dist
            elif right_dist == 0:
                min_dist = left_dist
            else:
                min_dist = min(left_dist, right_dist)
            dist_list.append(min_dist)
        return max(dist_list)

    def maxDistToClosest1(self, seats):
        """
        :type seats: List[int]
        :rtype: int
        """
        occ_list = [i for i in range(len(seats)) if seats[i] == 1]

        dist_list = [(occ_list[i + 1] - occ_list[i]) // 2 for i in range(len(occ_list) - 1)]
        front = occ_list[0]
        back = len(seats) - occ_list[-1] - 1
        return max([front] + dist_list + [back])

